import "bootstrap/dist/css/bootstrap.min.css";

function App() {
    return (
        <div className="container">
            <div className="row justify-content-between">
                <div className="col-auto">
                    Device 1
                    <img src="" alt="Device 1" />
                </div>
                <div className="col-auto">
                    Device 2
                    <img src="" alt="Device 2" />
                </div>
            </div>
        </div>
    );
}

export default App;
